INSERT INTO `rj45-stecker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/RJ45-Stecker/CSL - RJ45 Netzwerkstecker.webp;', 'CSL - RJ45 Netzwerkstecker', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo2OTEyMDgyNTE5MTUwMzIyOjE2Njc1MDc1NDU6c3BfYXRmOjIwMDU2ODc2MjYzMDAzOjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2Fkwmobile-RJ45-Netzwerkstecker-Zugentlastung-Steckverbinder%2Fdp%2FB08Q42QSX9%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D18YA5PX6ZA0WJ%26keywords%3DCSL%2B-%2BRJ45%2BNetzwerkstecker%26qid%3D1667507545%26sprefix%3Dcsl%2B-%2Brj45%2Bnet%252Caps%252C146%26sr%3D8-1-spons%26psc%3D1', '45,99', 4.0, 28, 0, 'kwmobile;SMART: Mit dem Netzwerkstecker Set von kwmobile machen Sie aus einem 8-adrigen Patchkabel oder Verlegekabel ein CAT 6A Netzwerkkabel mit RJ 45 Stecker - ideal für Verkabelungen in Bürogebäuden, Rechenzentren oder Heimnetzwerken.|WERKZEUGFREI: Durch den Klapp- bzw. Schraubverschluss der Steckverbinder ist für die Montage der CAT6A Kabel kein Werkzeug notwendig. Die Internetkabel werden einfach entsprechend der Pins in das Modul gesteckt und anschließend festgeschraubt.|PRAKTISCH: Die Kabelkontakte im Inneren des Moduls sind farblich gekennzeichnet. Dadurch fällt die korrekte Installation von Patchkabel oder Verlegekabel noch leichter.|STARK &amp; STABIL: Dank der Verwendung von robustem Metall und Kunststoff sind die Patchstecker strapazierfähig, belastbar und unempfindlich im Gebrauch.|WEITERE FEATURES: Die Stecker verfügen weiterhin über eine Zugentlastung und sind vollständig geschirmt.');
INSERT INTO `rj45-stecker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/RJ45-Stecker/VCE RJ45 Stecker.webp;', 'VCE RJ45 Stecker', 'https://www.amazon.de/VCE-Werkzeuglos-Verlegekabel-Netzwerkstecker-Feldkonfektionierbarer/dp/B088R6RS19/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=Q9JQFKOHUMBE&keywords=VCE+RJ45+Stecker&qid=1667507558&qu=eyJxc2MiOiIzLjE2IiwicXNhIjoiMy4wOCIsInFzcCI6IjIuMzAifQ%3D%3D&sprefix=vce+rj45+%2Caps%2C96&sr=8-4', '25,99', 4.3, 158, 2, 'VCE;RJ45 Cat8 stecker werkzeuglos ist passend für Cat8 Cat7A Cat7 Cat6A Verlegekabel, die AWG 26 bis AWG 22 und einen Kabelmanteldurchmesser 6 bis 9.5mm hat. 100% abwärtskompatibel zu anderen CAT-Varianten wie Cat.5/Cat.5e/Cat.6 / Cat.6a.|RJ45 stecker geschirmt: Abgeschirmtes Gehäuse mit Anti-Störung zur Gewährleistung der Qualität der Signalübertragung. Der vergoldete Phosphorbronze-Kontakte ist korrosionsbeständig, reibungsbeständig. Die Lebensdauer wird deshalb verlängert und die Übertragungsqualität wird verbessert.|Netzwerkstecker cat 8 werkzeuglos: Die Adern werden in eine Einfädelhilfe gezogen und in den Stecker eingeführt. Beim Verschließen des Gehäuses werden die Adern automatisch auf eine LSA-Modul gedrückt. Die verschraubbare Zugentlastung dient zum Befestigen der Adern. Die Vorgang kann ganz leicht innerhalb 2 Minuten ohne spezielles werkzeug im Feld beendet werden. Die Installation kann bei Bedarf wiederholt werden.|Betriebstemperatur: -30 ℃ bis 60 ℃. Haltekraft: 7,7 kg zwischen Buchse und Stecker. Geeignet für Power over Ethernet (PoE, PoE plus und UPoE).|Paket und Kundendienst: 4 Stück lan stecker cat8 werkzeuglos, 18 Monate Qualitätsgarantie. Rechnung mit MwSt. kann zur Verfügung gestellt werden.');
INSERT INTO `rj45-stecker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/RJ45-Stecker/Odedo RJ45-Stecker.webp;', 'Odedo RJ45-Stecker', 'https://www.amazon.de/Stecker-Terminal-Netzwerkstecker-Ethernet-Converter/dp/B076KPFR3S/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1FHUTO0Q8PECP&keywords=Odedo+RJ45-Stecker&qid=1667507569&qu=eyJxc2MiOiIyLjg5IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=odedo+rj45-%2Caps%2C96&sr=8-2', '10,90', 4.8, 77, 3, 'odedo;Geschirmter RJ45 8P8C Stecker auf 8-Pin Terminal Block mit 1:1 Schaltung , 568B Farbkodierung|Der odedo geschirmter RJ45 / Terminal Adapter verbindet die 8-Pins des 8P8C RJ45-Steckers mit den Schraubklemmen des sogenannten Terminalblocks für den Anschluss von Einzeldrähten. Dieser Adapter eignet für den einfachen Anschluss von offenen Kabelenden an die RJ45 Buchse, zum Beispiel für Ethernet-, Telefon- oder Steuerleitungen in industriellen Umgebungen.');
INSERT INTO `rj45-stecker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/RJ45-Stecker/SatShop-FT RJ01.webp;', 'SatShop-FT RJ01', 'https://www.amazon.de/SatShop-Ft-Verlegekabel-Netzwerkkabel-Anlegewerkzeug-Installationskabel-Cat-7-Werkzeugset/dp/B07NBMG1S3/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3Q644ERT4XZ40&keywords=SatShop-FT+RJ01&qid=1667507590&sprefix=satshop-ft%2Caps%2C123&sr=8-2', '32,95', 4.5, 560, 0, 'SatShop-Ft;Verlegekabel Cat.7 S/FTP PIMF Halogenfrei Reines Kupferkabel, 4 x 2 x AWG23/1|Bis zu 10Gbit Datendurchsatz auch für Power over Ethernet (PoE)/PoE+|Erfüllt Dämpfungswerte lt. Spezifikation Klasse FA (Cat.7a) bis 1000MHz ISDN und Ethernet- Verkabelungen ISO/IEC 11801 und EN 50575:2014|Geeignet für die gesamte Gebäudeverkabelung, Netzwerkdosen und Patchpanel|Lieferumfang: Cat7 Verlegekabel + 1x Crimpzange RJ45 mit Schneidmesser + 1x LSA Anlegewerkzeug + 1x Netzwerktester (ohne Batterie) + 1x Abisolierer + 1x Werkzeugtasche');
INSERT INTO `rj45-stecker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/RJ45-Stecker/CableCreation Cat6 RJ45 Stecker.webp;', 'CableCreation Cat6 RJ45 Stecker', 'https://www.amazon.de/CableCreation-Steckverbinder-RJ45-Steckverbinder-Crimp-Steckverbinder-UTP-Netzstecker/dp/B01K9Z4FT2/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2Y4VIR3W7WW6E&keywords=CableCreation+Cat6+RJ45+Stecker&qid=1667507600&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C176&sr=8-3', '12,99', 4.4, 3892, 1, 'CableCreation;✅100 Stück Rj45-Stecker für ungeschirmte Twisted-Pair-Massiv-oder verseiltes kabel, unterstützt 24 bis 26 AWG runden oder flachen Netzwerkkabel|✅Vergoldete Kontakte bieten zuverlässige Leistung für ein Gigabit Ethernet-Netzwerk|✅Sparen Sie Geld, indem Sie diese Anschlüsse verwenden, um Ihre eigenen Patchkabel zu erstellen|✅ROHS-konform, und die Farbe ist Transparent, ermöglichen das Eindringen von Indikatorlicht besser|✅Einfach zu tragen, vergoldete Stecker widerstehen Korrosion, verbessern die Signalleistung');
